class pdfReciept extends StatefulWidget {
  const pdfReciept({super.key});

  @override
  State<pdfReciept> createState() => _pdfRecieptState();
}

class _pdfRecieptState extends State<pdfReciept> {
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: MyAppBar(
        context: context,
        title: 'PDF',
        onLeadingTap: () => {
          goBack(context),
        },
        showActions: false,
      ),
      body: Center(
        child: PdfPreview(
          allowPrinting: true,
          onPrinted: (context) => {print("printed")},
          scrollViewDecoration: BoxDecoration(color: Colors.white),
          pdfPreviewPageDecoration: BoxDecoration(
            color: Colors.white,
            borderRadius: BorderRadius.circular(8.0.r),
            border: Border.all(
              color: CLR_GREY,
              width: 2.0,
            ),
          ),
          // actions: [Icon(Icons.download)],
          allowSharing: true,
          canChangeOrientation: false,
          canChangePageFormat: false,
          canDebug: false,
          initialPageFormat: PdfPageFormat.a4,
          loadingWidget: FlickrLoader(),
          build: (format) => _generatePdf(format, "title"),
        ),
      ),
    );
  }
}

Future<Uint8List> _generatePdf(PdfPageFormat format, String title) async {
  final pdf = pw.Document(
    version: PdfVersion.pdf_1_5,
    compress: true,
  );
  final font = await PdfGoogleFonts.nunitoExtraLight();

  String base64Image =
      "";

  final Uint8List imageBytes = base64Decode(base64Image);
  final pw.Image image = pw.Image(pw.MemoryImage(imageBytes));

  pdf.addPage(pw.Page(
      pageFormat: PdfPageFormat.a4,
      build: (pw.Context context) {
        return pw.Center(
          child: pw.Container(
            alignment: pw.Alignment.center,
            height: 200,
            child: image,
          ),
        );
      }));

  return pdf.save();
}
